import React, { Component } from "react";
import "../styles/product-list.css";

class ProductList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      orders: [
        {
          orderFee: 100,
          destination: "Your Destination",
          distance: 50,
          pickupDate: "2024-05-06",
          pickupTime: "10:00 AM",
          orderStatus: "Pending",
          paymentStatus: "Pending",
          rentalDates: "2024-05-06 to 2024-05-10",
          description: "hello",
          noOfPassengers: 5,
          noOfLuggages: 4,
          vehicles: {
            vehicleId: 1,
          },
          customer: {
            userId: 1,
          },
        },
        // You can add more orders as needed
      ],
    };
  }

  render() {
    const { orders } = this.state;

    return (
      <div className="product-list">
        <h1 className="product-list-title">Order List</h1>
        <table className="orders-table">
          <thead>
            <tr>
              <th>Order ID</th>
              <th>Order Fee</th>
              <th>Destination</th>
              <th>Distance</th>
              <th>Pickup Date</th>
              <th>Pickup Time</th>
              <th>Order Status</th>
              <th>Payment Status</th>
              <th>Rental Dates</th>
              <th>Description</th>
              <th>No. of Passengers</th>
              <th>No. of Luggages</th>
              <th>Vehicle ID</th>
              <th>User ID</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>${order.orderFee}</td>
                <td>{order.destination}</td>
                <td>{order.distance} miles</td>
                <td>{order.pickupDate}</td>
                <td>{order.pickupTime}</td>
                <td>{order.orderStatus}</td>
                <td>{order.paymentStatus}</td>
                <td>{order.rentalDates}</td>
                <td>{order.description}</td>
                <td>{order.noOfPassengers}</td>
                <td>{order.noOfLuggages}</td>
                <td>{order.vehicles.vehicleId}</td>
                <td>{order.customer.userId}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  }
}

export default ProductList;


